/* Custom background for Roblox */
body {
    background-image: url('https://www.summitcomedy.com/wp-content/uploads/2019/09/Kevin-Hart-2-400x203.jpeg') !important;
    background-size: cover;
    background-position: center;
    background-repeat: no-repeat;
    background-attachment: fixed;
    margin: 0; /* Add this line to remove default margins */
    height: 100vh; /* Ensures the background covers the full height */
}
